    let bar = new progress('  Assign tag to users [:bar] :percent :etas', {
        complete: '=',
        incomplete: ' ',
        width: 20,
        total: datas.length
    });

    Promise.each(datas, (data, user_id) => {
        let tagsId = data.tags.split(', ');
        user_id += 1;
        return Promise.each(tagsId, (tag_id) => {
            return new Promise((resolve, reject) => {
                if (tag_id > 200)
                    return resolve();
                Tag.addForUser(user_id, tag_id, (err, result) => {
                    if (err && err.code !== 'ER_NO_REFERENCED_ROW_2')
                        return reject(err);
                    return resolve();
                })
            });
        }).then(() => {
            bar.tick(1);
        });
    }).then(() => {
        console.log('\nMatcha database is ready. Now run `npm install` and `npm run dev`');
        return process.exit();
    }).catch((err) => {
        bar.interrupt('Error SQL : ', err.code);
        return process.exit();
    });
